description:
They made their own rules in Sex &amp; Marriage

Here is a love story like no other. Filmed in a lavish way (reminiscent of those high budget night-time evening soaps) it boldly reveals a sexual liasion between four passionate people.

The wife: a famous writer for magazines who finds mental and physical gratification from her artistic lesbian girlfriend.

The husband: a man who appeases his sexual appetite with his wife in a most brutish way, which repels and yet excites her deeply.

The wife's lover: Her insatiable desire for sexual variety drives her to his door, begging him to fulfill her deepest desires.

Sensitive. Sensual. Unforgettable. Unmistakingly, Anthony Spinelli's Portrait Of An Affair.

